import requestAPI from "../../../util/baseUrlCustomer";

export function getOrderItems(param) {
  return requestAPI({
    url: "/OrderItem/GetOrderItems",
    method: "Get",
    params: param,
  });
}
export function getAccountWithOutOrderItem(param) {
  return requestAPI({
    url: "/OrderItem/GetAccountWithOutOrderItem",
    method: "Get",
    params: param,
  });
}

export function insertOrderItemRequest(data) {
  return requestAPI({
    url: "/OrderItem/InsertOrderItemRequest",
    method: "Post",
    data,
  });
}

